import React from "react"
import "./../styles/map.scss"
import { IRegionPricing } from "~/interfaces"

interface IStateMapProps {
  selectedRegion? : string
  pricingData: IRegionPricing[]
  onClick : (state: string) => void
}

const isPriceAdded = (regionName: string, data: IRegionPricing[]): boolean => {
  const isPriceAdded: IRegionPricing[] = data.filter(region => region.name === regionName, data)

  return isPriceAdded.length > 0
}

const viewClasses = (region: string, selectedRegion: string | undefined, data: IRegionPricing[]): string => {
  return `${selectedRegion === region && "selected"} ${isPriceAdded(region, data) && "price-added"}`
}

